import { Carousel } from 'antd';
import React from 'react';

function Home() {

  const carouselBS: React.CSSProperties = {
    width: '100vw',
    height: '100vh',
    position: 'relative',
  };

  const carouselCS: React.CSSProperties = {
    width: '100%',
    height: '100%',
    position: 'absolute',
  };

  const carouselConfig = {
    autoplay: true,
  };

  return (<>
    <div style={carouselBS}>
      <Carousel {...carouselConfig}>
        <div>
          <h3 >1</h3>
        </div>
        <div>
          <h3 >2</h3>
        </div>
      </Carousel>
      <div style={carouselCS}>

      </div>
    </div>
  </>);
}
export default Home;
